-- ----------------------------
-- Procedure structure for INSERT_PROJECT_PARAMETER_BY_NO
-- ----------------------------
DROP PROCEDURE IF EXISTS `INSERT_PROJECT_PARAMETER_BY_NO`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `INSERT_PROJECT_PARAMETER_BY_NO`(IN `PROJECT_NO` varchar(50))
BEGIN
	SELECT
		PROJECT_NO AS NO,
		PAR.ID AS PARAMETER_ID,
		PAR.SOURCE_VALUE,
		PAR.PARAMETER,
		PAR.UNIT,
		1 AS IS_DISPLAY,
		NOW() AS CREATE_DATE,
		'admin' AS CREATOR,
		NOW() AS UPDATE_DATE,
		'admin' AS UPDATE_USER
	FROM PARAMETER_INFO PAR;
END
;;
DELIMITER ;
